<script>
  import { onMount } from "svelte";



  onMount(() => {
    // Selecteer de 9e sectie die de SVG bevat
    const section = document.querySelector(".data-story:nth-of-type(9)");

    const paths = section.querySelectorAll("svg path");

    const totalDuration = 10;
    const fadeDuration = 1; 
    const delayBetweenPaths = (totalDuration - fadeDuration) / (paths.length - 1);

    const observer = new IntersectionObserver(entries => {
      entries.forEach(entry => {
        if (entry.isIntersecting) {
          paths.forEach((path, index) => {
            setTimeout(() => {
              path.style.transition = `opacity ${fadeDuration}s`;
              path.style.opacity = 1; 
            }, index * delayBetweenPaths * 300);
          });
        }
      });
    }, {
      rootMargin: '0px', 
      threshold: 0.5 
    });

    // Observeer de sectie
    observer.observe(section);

    paths.forEach(path => {
      path.style.opacity = 0;
    });

  });

  function scrollToSphere() {
    const speechSphere = document.querySelector('.sphere');
    if (speechSphere) {
      speechSphere.scrollIntoView({ behavior: 'smooth' }); // Smooth scroll-effect
    }
  }
</script>

